package types

import (
	"testing"
)

func Test_GetAssetInfo(t *testing.T) {
	var response DecryptTxDetailsResponse
	response.TxInJSON = ""

	assetInfo, err := response.GetAssetInfo()
	if err != nil {
		t.Fatalf("failed to get asset info: %v", err)
	}
	if assetInfo == nil {
		t.Fatalf("asset info is nil")
	}

	if !assetInfo.IsValidTransferAssetOwnershipOperation() {
		t.Fatalf("expected valid transfer asset ownership")
	}
	if assetInfo.OptDescriptor.OwnerEthPubKey != "037842e900cb7b1d7bfe3e5fce3ff021bac187f472834e86c61531fa020519761f" {
		t.Fatal("unexpected owner eth pub key")
	}
	if *assetInfo.OptAssetId != "d522e4672bddd28fc6ed66f8962541e4058fab5d1e7481fd4773206aba799e02" {
		t.Fatal("unexpected asset id")
	}
}
